typedef struct
{
  uint64_t *b;
  int nb;
} ESL_BITFIELD;

static inline void
esl_bitfield_Set(ESL_BITFIELD *b, int i)
{
  b->b[i / 64] |= (1ull << (i % 64));
}

static inline void
esl_bitfield_Clear(ESL_BITFIELD *b, int i)
{
  b->b[i / 64] &= ~(1ull << (i % 64));
}

static inline void
esl_bitfield_Toggle(ESL_BITFIELD *b, int i)
{
  b->b[i / 64] ^= (1ull << (i % 64));
}

static inline int
esl_bitfield_IsSet(const ESL_BITFIELD *b, int i)
{
  return ((b->b[i / 64] & (1ull << (i % 64))) ? 1 : 0);
}

